Ad Text:
This is an exciting opportunity to be at the forefront of Data Analytics and Artificial Intelligence for one of Queensland’s most well respected organisations. You will join a high impact transformation program where AI is being embedded into real enterprise operations, delivering measurable business outcomes across finance, ERP, and customer service environments.
 
I am looking for an experienced AI Engineer who can design, build, and operationalise production grade, agentic AI solutions. This role is ideal for someone who understands how to move AI beyond experimentation and into safe, reliable, observable, and auditable enterprise workflows.
 
You will work with modern Azure based platforms including Azure AI Foundry and Microsoft Fabric, building intelligent agents and multi agent workflows that integrate seamlessly with enterprise systems and processes.
 
The Role
 
As the AI Engineer, you will be responsible for designing and delivering AI driven solutions that automate complex business processes and enhance operational efficiency. You will work across financial and ERP transactional functions such as accounts payable and receivable, payroll, and debt management, while also enabling AI powered customer support solutions for contact centres and property helpdesks.
 
You will collaborate closely with solution architects, data engineers, and technical analysts to deliver ethical, high quality, and production ready AI solutions aligned to organisational strategy.
 
Key Responsibilities

Design and deploy AI agents using Azure AI Foundry or equivalent platforms;
Build multi agent workflows including planner executor, reviewer, routing, and human in the loop patterns;
Integrate agents with enterprise systems using secure tool and function calling;
Implement event driven and resilient orchestration using Logic Apps, Functions, Service Bus, Event Grid, and API Management;
Apply enterprise grade reliability patterns including retries, idempotency, and recovery handling;
Establish guardrails including validation, policy enforcement, and confidence thresholds;
Implement full observability including logging, tracing, telemetry, and audit trails;
Apply security best practices including Managed Identity, Key Vault, RBAC, and secure networking;
Deliver production quality code with CI CD, automated testing, and infrastructure as code;
Produce clear architecture artefacts, API specifications, and operational documentation;
Test and evaluate models for accuracy, performance, and business suitability; and
Integrate AI solutions into existing applications, APIs, and workflows.
About You
 
You are an engineer who understands how to make AI operational inside large organisations. You bring strong systems thinking, deep cloud experience, and the ability to design resilient, secure, and scalable AI solutions.

Bachelor’s degree in Computer Science, Engineering, Data Analytics, or equivalent experience;
Five or more years in software, integration, or data engineering roles;
Hands on experience with Azure AI Foundry or equivalent agent based AI platforms;
Strong experience with Azure Integration Services including Logic Apps, Service Bus, Event Grid, Functions, and API Management;
Practical experience building RAG and grounded AI solutions;
Strong coding skills in Python and or TypeScript or C#;
Experience with distributed systems and event driven architecture;
Experience with GitHub or Azure DevOps; and
Ability to work autonomously and contribute strategically to transformation programs.
This is a rare opportunity to shape how AI is delivered at enterprise scale within a highly respected Queensland organisation. If you are passionate about building real world AI solutions that are secure, scalable, and impactful, this role will put you at the centre of meaningful digital transformation.
 
